          display: "flex",
          width: "auto",
          backgroundColor: "#f4f3f4",
          height: "120px",
          marginTop: "2rem",
          borderRadius: "0.8rem",
          fontFamily: "DungGeunMo",
          fontSize: "1.5rem",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <p>COMING SOON...</p>
      </div>
    </div>
  );
}

export default Retirement;
